import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  Dimensions,
  Animated,
  Image,
} from 'react-native';

const { width: screenWidth, height: screenHeight } = Dimensions.get('window');


const SideMenu = ({ isVisible, onClose }) => {
  const slideAnim = React.useRef(new Animated.Value(screenWidth)).current;

  React.useEffect(() => {
    if (isVisible) {
      Animated.timing(slideAnim, {
        toValue: 0,
        duration: 300,
        useNativeDriver: true,
      }).start();
    } else {
      Animated.timing(slideAnim, {
        toValue: screenWidth,
        duration: 300,
        useNativeDriver: true,
      }).start();
    }
  }, [isVisible, slideAnim]);

  if (!isVisible) return null;

  const menuItems = [
    { id: 'perfil', title: 'Perfil', y: 200, height: 42 },
    { id: 'ranking', title: 'Ranking', y: 269, height: 42 },
    { id: 'chat', title: 'Chat', y: 339, height: 41 },
    { id: 'tutorial', title: 'Tutorial', y: 408, height: 42 },
    { id: 'menu', title: 'Menu', y: 477, height: 42 },
  ];

  return (
    <View style={styles.overlay}>
      <TouchableOpacity style={styles.backdrop} onPress={onClose} />
      <Animated.View
        style={[
          styles.menuContainer,
          {
            transform: [{ translateX: slideAnim }],
          },
        ]}
      >
        {/* Background SVG */}
        <Image 
          source={require('./img/SideMenu.svg')} 
          style={styles.backgroundSvg}
          resizeMode="cover"
        />

        {/* Close Button - Line 1 and Line 2 */}
        <TouchableOpacity style={styles.closeButton} onPress={onClose}>
          <View style={styles.closeIcon}>
            <View style={[styles.closeLine, styles.closeLine1]} />
            <View style={[styles.closeLine, styles.closeLine2]} />
          </View>
        </TouchableOpacity>

        {/* User Profile Section */}
        <View style={styles.userProfile}>
          <Image
            source={require('./img/aiAtivo 1logo.png')}
            style={styles.userAvatar}
            resizeMode="cover"
          />
          <Text style={styles.userGreeting}>Oi, Carolline</Text>
        </View>

            {/* Menu Items with Gradient Borders */}
            {menuItems.map((item, index) => (
              <View key={item.id} style={[styles.menuItemContainer, { top: item.y - 23 }]}>
                {/* Top gradient line - exact Figma gradient */}
                <View style={styles.menuItemBorderTop}>
                  {/* Left fade to solid */}
                  <View style={[styles.gradientSegment, styles.gradientLeft]}>
                    <View style={styles.gradientFadeLeft} />
                  </View>
                  {/* Center white */}
                  <View style={[styles.gradientSegment, styles.gradientCenter]}>
                    <View style={styles.gradientWhite} />
                  </View>
                  {/* Right solid to fade */}
                  <View style={[styles.gradientSegment, styles.gradientRight]}>
                    <View style={styles.gradientFadeRight} />
                  </View>
                </View>
                {/* Bottom gradient line - exact Figma gradient */}
                <View style={styles.menuItemBorderBottom}>
                  {/* Left fade to solid */}
                  <View style={[styles.gradientSegment, styles.gradientLeft]}>
                    <View style={styles.gradientFadeLeft} />
                  </View>
                  {/* Center white */}
                  <View style={[styles.gradientSegment, styles.gradientCenter]}>
                    <View style={styles.gradientWhite} />
                  </View>
                  {/* Right solid to fade */}
                  <View style={[styles.gradientSegment, styles.gradientRight]}>
                    <View style={styles.gradientFadeRight} />
                  </View>
                </View>
                {/* Menu Item Text */}
                <View style={[styles.menuItemTextContainer, { height: item.height }]}>
                  <Text style={styles.menuItemText}>{item.title}</Text>
                </View>
              </View>
            ))}
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: 1000,
  },
  backdrop: {
    flex: 1,
    backgroundColor: 'transparent',
  },
  menuContainer: {
    position: 'absolute',
    top: 23, // Exact Figma y position
    right: 0,
    width: 229, // Exact Figma width
    height: 570, // Exact Figma height
  },
  backgroundSvg: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    width: '100%',
    height: '100%',
  },
  closeButton: {
    position: 'absolute',
    top: 20, // 43 - 23 = 20
    right: 20, // 371 - 175 = 196, but we need it at right edge
    width: 20,
    height: 20,
    justifyContent: 'center',
    alignItems: 'center',
  },
  closeIcon: {
    width: 18.38, // Exact Figma width
    height: 18.38,
    justifyContent: 'center',
    alignItems: 'center',
  },
  closeLine: {
    position: 'absolute',
    width: 18.38,
    height: 3, // Exact Figma strokeWeight
    backgroundColor: '#fff', // Exact Figma color
  },
  closeLine1: {
    transform: [{ rotate: '45deg' }],
  },
  closeLine2: {
    transform: [{ rotate: '-45deg' }],
  },
  userProfile: {
    position: 'absolute',
    top: 69, // 92 - 23 = 69
    left: 11, // 186 - 175 = 11
    flexDirection: 'row',
    alignItems: 'center',
  },
  userAvatar: {
    width: 55, // Exact Figma width
    height: 55, // Exact Figma height
    borderRadius: 27.5,
  },
  userGreeting: {
    marginLeft: 15, // 256 - 186 - 55 = 15
    fontSize: 20,
    fontWeight: '600',
    color: '#fff', // Exact Figma color
  },
  menuItemContainer: {
    position: 'absolute',
    left: 3, // 178 - 175 = 3
    width: 226, // Exact Figma width
    backgroundColor: 'transparent', // Transparent background
  },
  menuItemBorderTop: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: 1, // Slightly thicker for visibility
  },
  menuItemBorderBottom: {
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
    height: 1, // Slightly thicker for visibility
  },
  gradientSegment: {
    position: 'absolute',
    top: 0,
    height: 1,
  },
  gradientLeft: {
    left: 0,
    width: '9.6%', // Position 0-0.096
  },
  gradientCenter: {
    left: '45.2%', // Position 0.5 - slightly wider for better blend
    width: '9.6%', // Center section
  },
  gradientRight: {
    right: 0,
    width: '9.6%', // Position 0.899-1
  },
  gradientFadeLeft: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: 1,
    // Position 0-0.096: transparent to solid cyan
    backgroundColor: 'rgba(47, 212, 205, 0.6)',
    opacity: 0.8,
  },
  gradientWhite: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: 1,
    // Position 0.5: white center
    backgroundColor: 'rgba(255, 255, 255, 0.9)',
    opacity: 1,
  },
  gradientFadeRight: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: 1,
    // Position 0.899-1: solid cyan to transparent
    backgroundColor: 'rgba(47, 212, 205, 0.6)',
    opacity: 0.8,
  },
  menuItemTextContainer: {
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 20,
  },
  menuItemText: {
    fontSize: 20,
    fontWeight: '500',
    color: '#fff', // Exact Figma color
    textAlign: 'center',
  },
});

export default SideMenu;
